import classes from './Button.module.css';

function Button(props) {

    let color;
    console.log(props);

    switch(props.look) {
        case ('music'):
            color = '#FBFDFD';
            break;
        case ('poltics'):
            color = 'red';
        default: 
            color = 'white';
            break;
    }

    return (
        <button
            className={classes.Button}
            style={{backgroundColor: color}}
            onClick={props.clickHandler}
            type={props.type}>
            {props.children}
        </button>
    );
}

export default Button;
